import React, {useState, useEffect} from 'react';
import Elem from './ListElement';

function ListPresenter ({ cur }) {
    // console.log("cur: ", cur);
    // cur.map(item=>console.log("item: ", item));
    return(
        <div className="Container">
        {cur.map(item=>(
            <Elem cur={item}/>
        ))}
            <p>List Presenter</p>
        </div>
    );
}   
export default ListPresenter;
